class Solution:
    def shortestPalindrome(self, s: str) -> str:
        for i in range(len(s), -1, -1):
            if self.is_palindrome(s[:i]):
                return s[i:][::-1] + s


    def is_palindrome(self, s):
        if len(s) < 2:
            return True
        else:
            return s == s[::-1]




# 输入: "abcd"
# 输出: "dcbabcd"
a = ""
import time
t = time.time()
print(Solution().shortestPalindrome(a))
print(time.time()-t)